  { id: "p1", title: "Product 1" },
  { id: "p2", title: "Product 2" },
  { id: "p1", title: "Product 1" },
];

function ProductsPage() {
  return (
    <>
      <h1>The Products Page</h1>
      <ul>
        <li>
          <Link to="/products/product-1">Prod 1</Link>
        </li>
        <li>
          <Link to="/products/product-2">Prod 2</Link>
        </li>
        <li>
          <Link to="/products/product-3">Prod 3</Link>
        </li>
      </ul>
    </>
  );
}

export default ProductsPage;
